import React from 'react';
import { Pagination, PaginationItem, PaginationLink } from 'reactstrap';

export class Paginate extends React.Component {

  render() {
    return (
      <Pagination aria-label="Page navigation example">
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=1553252528936&offset=0&limit=8&apikey=ce1693d8baa06f879abcab4c75c19e34006074db&hash=7c500b14e39985175e879c9690073d45`}>1</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=1553252528936&offset=8&limit=16&apikey=ce1693d8baa06f879abcab4c75c19e34006074db&hash=7c500b14e39985175e879c9690073d45`}>2</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=1553252528936&offset=16&limit=24&apikey=ce1693d8baa06f879abcab4c75c19e34006074db&hash=7c500b14e39985175e879c9690073d45`}>3</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=1553252528936&offset=24&limit=32&apikey=ce1693d8baa06f879abcab4c75c19e34006074db&hash=7c500b14e39985175e879c9690073d45`}>4</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href="#">
            5
          </PaginationLink>
        </PaginationItem>
      </Pagination>
    );
  }
}
export default Paginate;
